package com.set;

import java.util.HashSet;

public class HashSetDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		HashSet hash = new HashSet();
		hash.add(10);
		hash.add("Ganesh");
		hash.add("Mininath");
		hash.add(10.5);
		hash.add(null);
		hash.add(10);
		hash.add("Ganesh");

		System.out.println(hash);

	}

}
